import React from 'react'
import PropTypes from 'prop-types'
import { BrowserRouter as Router, Link, Switch } from 'react-router-dom'

function Card({ toLoad, values }) {
  if (toLoad === false) {
    ;<div>
      loading ...<h1></h1>
    </div>
  }

  return (
    <Router>
      <div>
        {values.map((ele) => {
          return (
            <Link to={`/${ele.id}`} key={ele.id}>
              <div className="homepage-card" key={ele.id}>
                <h1>{ele.name}</h1>
              </div>
            </Link>
          )
        })}
      </div>
      <div>
        {values.map((ele) => {
          return (
            <Switch id={ele.key}>
              <Route to={`/${ele.id}`} key={ele.id}>
                <div className="homepage-card" key={ele.id}>
                  <h1>{ele.name}</h1>
                </div>
              </Route>
            </Switch>
          )
        })}
      </div>
    </Router>
  )
}

Card.propTypes = {
  values: PropTypes.array.isRequired,
  toLoad: PropTypes.bool.isRequired
}
export default Card
